INSERT INTO `lawns` (`id`, `name`, `locality`, `specification`, `desription`, `address`, `vendor_id`, `contact`, `email`, `price`, `images`, `status`, `created_at`, `updated_at`) VALUES
(10, 'Poornima Lawn', 'Ashapur', '<p>600 to 900 per plate</p>', '<p>Poornima Lawn and Banquet is a very nice wedding venue in Varanasi. A couple must plan many things before they take their wedding vows and be united forever. One crucial aspect is the wedding venue where all your functions will take place. Therefore, if you are looking for a wedding venue that offers you a wide range of services and packages at budget-friendly rates, then poornima lawn and Banquet is your choice. Venue is located in the varanasi city, thus making it accessible to all your guests from any mode of transportation.</p>\r\n<p>In Poornima lawn are equipped to capacitate a crowd of 500 to 1500 guests at once.</p>\r\n<p>The venue is the best place to host any pre-wedding or post-wedding function with great ease and perfection. It is an ideal place in Varanasi where you can also plan the destination wedding of your dreams</p>', '<h1>Sa21/5 Ashapur Chauraha, Varanasi -221007</h1>', '3', '7985764500', 'poornimalawn@gmail.com', '250000', 'images/lawn/10011686640548648817a49c647.jpeg,images/lawn/87971686640548648817a49c896.jpeg,images/lawn/37611686640548648817a49cac3.jpeg,images/lawn/78261686640548648817a49ccf6.jpeg,images/lawn/90691686640548648817a49cebd.jpeg,images/lawn/28341686640548648817a49d04c.jpeg,images/lawn/36971686640548648817a49d1eb.jpeg,images/lawn/70151686640548648817a49d34f.jpeg,images/lawn/59301686640548648817a49d56e.jpeg,images/lawn/82071686640548648817a49d6f4.jpeg,images/lawn/91211686640548648817a49d8bd.jpeg', 1, '2023-06-13 07:15:48', '2023-11-14 04:16:38'),
(11, 'Shavitri Vila', 'Ashapur', '<h3><strong>&nbsp;<span style=\"color: rgb(224, 62, 45);\">₹</span> 1550 </strong>to <strong>1700 </strong>per plate</h3>', '<p>Very <strong>good </strong>Lawn</p>\r\n<p><strong>Facility:-</strong></p>\r\n<ol>\r\n<li><strong>Catering</strong></li>\r\n<li><strong>Decoration</strong></li>\r\n<li><strong>Parking</strong></li>\r\n</ol>', '<p><strong>Ledhupur</strong>, Ashapur, Varanasi</p>', '2', '8299367123', 'prashantjaiswal345@gmail.com', '250000', 'images/lawn/7680168666548164887909147b7.jpg,images/lawn/7711168666548164887909159e7.jpg', 1, '2023-06-13 14:11:21', '2023-10-06 06:26:17'),
(13, 'Sanskaar Vatika', 'Ashapur, Sarnath', '1200to2200', 'sanskaar lawn and Banquet is a wedding venue based out of Varanasi. A couple must plan many things before they take their wedding vows and be united forever. One crucial aspect is the wedding venue where all your functions will take place. Therefore, if you are looking for a wedding venue that offers you a wide range of services and packages at budget-friendly rates, then sanskaar lawn and Banquet is your choice. Venue is located in the varanasi city, thus making it accessible to all your guests from any mode of transportation. In sanskaar lawn are equipped to capacitate a crowd of 500 to 1500 guests at once. The venue is the best place to host any pre-wedding or post-wedding function with great ease and perfection. It is an ideal place in Varanasi where you can also plan the destination wedding of your dreams.', 'Ashapur,sarnath', '6', '6387752037', 'updeshpandey8574@gmail.com', '300000', 'images/lawn/5758168976954964b7d64dbe9f1.jpeg,images/lawn/7836168976954964b7d64dbedd9.jpeg,images/lawn/6551168976954964b7d64dbef2b.jpeg,images/lawn/8244168976954964b7d64dbf0c5.jpeg,images/lawn/9658168976954964b7d64dbf1d4.jpeg,images/lawn/8132168976954964b7d64dbf2db.jpeg,images/lawn/5242168976954964b7d64dbf3fa.jpeg,images/lawn/9865168976954964b7d64dbf4f6.jpeg,images/lawn/6564168976954964b7d64dbf5e9.jpeg,images/lawn/2287168976954964b7d64dbf700.jpeg,images/lawn/6446168976954964b7d64dbf7f5.jpeg,images/lawn/4277168976954964b7d64dbf900.jpeg,images/lawn/8180168976954964b7d64dbfa10.jpeg,images/lawn/8823168976954964b7d64dbfb28.jpeg,images/lawn/3415168976954964b7d64dbfc07.mp4', 1, '2023-07-19 12:25:49', '2023-08-28 04:04:55'),
(14, 'Virat Vatika', 'Sarnath, Ashapur road', '1200 to 2200', 'Virat Vatika, a luscious venue based in Varanasi, is perfect for the grand affair like your wedding. Equipped with world-class facilities, the venue is spacious and comfortable. They offer complete event support for all your nuptial ceremonies and events. With their class apart services, you are ensured that every experience with them is unique, every time. This venue is an ideal choice for your wedding as it can hold lavish as well as a simple and subtle wedding. Vibrant and progressive, Brick Field retains the warmth and spirit of India while offering a grand hall. The services go far above and beyond the conventional venue and catering staples. All these services would be customized according to your demands, needs, and budget, a luscious venue based in Varanasi, is perfect for the grand affair like your wedding. Equipped with world-class facilities, the venue is spacious and comfortable. They offer complete event support for all your nuptial ceremonies and events. With their class apart services, you are ensured that every experience with them is unique, every time. This venue is an ideal choice for your wedding as it can hold lavish as well as a simple and subtle wedding. Vibrant and progressive, Brick Field retains the warmth and spirit of India while offering a grand hall. The services go far above and beyond the conventional venue and catering staples. All these services would be customized according to your demands, needs, and budget.', 'Sarnath,Ashapur Road Varanasi', '6', '+91 6387 752 037', 'updeshpandey8574@gmail.com', '250000', 'images/lawn/4226168991279964ba05df94989.jpeg,images/lawn/6503168991279964ba05df94b85.jpeg,images/lawn/6994168991279964ba05df94cd8.jpeg,images/lawn/1550168991279964ba05df94e26.jpeg,images/lawn/3141168991279964ba05df94f67.jpeg,images/lawn/9621168991279964ba05df950a5.mp4', 1, '2023-07-21 04:13:19', '2023-07-21 04:13:19'),
