(35, 'Garun Lawn', 'Chandmari, indian petrol pump, Ringroad Varanasi', '<p>Garun lawn and banquet</p>\r\n<p>More the 1.5 acre of campus with occupancy of more than 1000 people.&nbsp;</p>\r\n<p>5000 sqft ac banquet hall with sitting of more than 300 person</p>\r\n<p>8 rooms with attached washroom with gyser and air conditioner</p>\r\n<p>Lush green campus</p>\r\n<p>Parking for more than 50 cars</p>', '<p>1000-1600</p>', 'Bhojubeer Road, chandmari Ringroad, Varanasi', '32', '+919648520203', 'Garunlawn14@gmail.com', '3 lakh', 'images/lawn/80171733111703674d2f97036c5.jpg,images/lawn/31061733111703674d2f9703a68.jpg,images/lawn/76371733111703674d2f9703cbf.jpg,images/lawn/80821733111703674d2f970402e.jpg,images/lawn/27671733111703674d2f9704248.jpg,images/lawn/85031733111703674d2f9704438.jpg,images/lawn/33331733111703674d2f9704651.jpg,images/lawn/66841733111703674d2f9704864.jpg,images/lawn/71281733111703674d2f9704a71.jpg,images/lawn/94351733111703674d2f9704c84.jpg,images/lawn/27951733111703674d2f9704e53.jpg', 1, '2024-12-02 03:55:03', '2024-12-29 16:07:59'),
(36, 'Ritu Upwan', 'Benipur Pokhara, Varanasi', '<h4>At Ritu Upwan you can celebrate your functions in your budget.</h4>', '<h5>This one is such a nice lawn to explore your dreamy wedding and any event.</h5>\r\n<h4>Facilities of the Lawn :</h4>\r\n<ol>\r\n<li>This lawn having a big grass area.</li>\r\n<li>Comfortably parking your wheelers.</li>\r\n<li>Such a nice decoration of stage and lightings.</li>\r\n<li>Maximum number of guests can exist here.</li>\r\n</ol>\r\n<p>and many more facilities are here...</p>\r\n<p>&nbsp;</p>\r\n<p>For more details contact us.</p>', 'Benipur Pokhara, Varanasi', '33', '84009 26009', 'akashlawn@gmail.com', '700 - 1500', 'images/lawn/69611735488456677173c8357af.jpg,images/lawn/70881735488456677173c835aa7.jpg,images/lawn/49591735488456677173c835c93.jpg,images/lawn/35521735488456677173c835de9.jpg,images/lawn/27341735488456677173c835eea.jpg,images/lawn/22121735488456677173c836051.jpg,images/lawn/33651735488456677173c836210.jpg', 1, '2024-12-29 16:07:36', '2024-12-29 16:07:36'),
(37, 'SHIV KASHI', 'Chandmaari Baypass, Varanasi', '<h4>Shiv Kashi lawn is a sweet place to celebrate your function with full of joy.</h4>', '<h4>This lawn have a very beautiful interiors with a nice banquet hall.</h4>\r\n<p>About Lawn :</p>\r\n<ol>\r\n<li>This lawn have limited ground area with attractive decoration.</li>\r\n<li>It have 4 Rooms with a perfect banquet hall&nbsp;</li>\r\n<li>There is out side parking behind the lawn&nbsp;</li>\r\n<li>It gives you a beautiful and nice stage area.</li>\r\n</ol>\r\n<p>many more facilities are included inside lawn.</p>\r\n<h5>for more details contact with us.</h5>', 'Chandmaari Baypass, Varanasi', '33', '96956 69933', 'akash@gmail.com', '700 - 1500', 'images/lawn/4136173549029567717af7181f0.jpg,images/lawn/2412173549029567717af7183ca.jpg,images/lawn/6481173549029567717af7184ce.jpg,images/lawn/5843173549029567717af718628.jpg,images/lawn/1791173549029567717af71871c.jpg', 1, '2024-12-29 16:38:15', '2024-12-29 16:38:15');

